import styles from './Login.module.css';

const Login = () => {
    return (
        <div className="login">
            <h2>Login</h2>
            <form>
                <input type="text"></input>
                <input type="password"></input>
                <button>Log in</button>
            </form>
        </div>
    );
}

export default Login;
